import Button from './components/Button';
import Input from './components/Input';
import {Container, Content, Row, Colunm} from './styles';

const App = () => {
  return (
    <Container>
      <Content>
        <Input />
        <Row>
          <Button label="4"/>
          <Button label="5"/>
          <Button label="6"/>
          <Button label="+"/>
        </Row>
        <Row>
          <Button label="1"/>
          <Button label="2"/>
          <Button label="3"/>
          <Button label="="/>
        </Row>

      </Content> 
    </Container>
  );
}

export default App;
